    "n": "Для прохождения квеста вам понадобиться: 1) Пройденный квест 2) 366 Остер 3) 690 Ротенот 4) 211 Вартфиш 5) 50 кораллов 6) 712 Льдинкус(должен быть пойман именно вами и только во время прохождения этого этапа!) 7) 357 Пальмер со скрытой силой огонь",
    "tp": "Text",
    "tx": "Для прохождения квеста вам понадобиться:\r\n1) Пройденный квест \n2) 366 Остер\r\n3) 690 Ротенот\r\n4) 211 Вартфиш\r\n5) 50 кораллов\r\n6) 712 Льдинкус(должен быть пойман именно вами и только во время прохождения этого этапа!)\r\n7) 357 Пальмер со скрытой силой огонь",
    "pr": "font-family: Montserrat;\nfont-size: 16px;\nfont-weight: 700;\ntext-transform: none;\nletter-spacing: 0%;\n-pt-paragraph-spacing: 0;\nborder-width : 1px;\n-pt-border-position: outside;\nbackground-color: #0000007f;\n"
