    "w": 809,
    "h": 1100,
    "ii": 68,
    "n": "Шаг 1. Взять квест Вы можете, поговорив Мальчиком с дочкой (Южный Архипелаг > о.Сифам > Каменистый пляж).  Мальчик собирает коллекцию морских обитателей и ему нехватает нужных экземпляров, а именно : Остер, Ротенот и Вартфиш(ловятся: Южный Архипелаг > о. Синнабар > Сен-Аспир > Гавань > Песчаная тропа > Коралловая лагуна > Мелководье > Коралловая роща).  После получения заветных трофеев, мальчик раскажет вам что катер Кори и Нолана потерпел крушение, а их вынесло на необитаемый остров. Там их подобрали пираты, теперь отец с дочерью вынуждены прислуживать бандитам. Мальчик направляет вас в прибрежный бар, где вы можете расспросить завсегдатых. Шаг 2. Направляемся в прибрежный бар (Южный Архипелаг > о. Синнабар > Сен-Аспир > Гавань > Песчаная тропа > Коралловая лагуна > Мелководье > Прибрежный бар). В баре встречаем Уильяма, но что бы он рассказал нам нужную информацию, он просит принести 50 кораллов. Шаг 3. Выбиваем кораллы и приносим их Уильяму. У него была стычка с пиратами, после чего мужчину скинули за борт. Благо, что этот смельчак выбрался и теперь может рассказать много интересного! И чтобы попасть на пиратский корабль нужно найти потерянный флаг.  (Южный Архипелаг > о. Синнабар > Сен-Аспир > Гавань > Песчаная тропа > Скалистый залив) Шаг 4. В скалистом заливе встречаем сёрфингиста и чтобы добыть флаг вам предстоит выиграть гонку с препятствиями. ( ).  За победу получаем пиратский флаг. Приходим в гавань и находим пирата Дэва. Разговариваем с ним о найденном флагеи о том что ищем боцмана, о нахождение боцмана он расскажет вам за стол. Шаг 5. Направляемся к Уильямсу, он предлагает поймать Льдинкуса так как он очень похож на нужный стол, так же просит поймать Пальмера со скрытой силой огонь для своего плана. (Льдинкусы обитают в ледяной пещере: Иль де Фар > Каменистый пляж > Ледяная пещера. Пальмеры: о.Синнабар > Торговый квартал > Предгорье Синнабунга).  Возвращаемся к нему с пойманными монстрами и отдаем Пальмера, потом идем к пирату Дэву и отдаем Льдинкуса. Шаг 6. Дэв рассказл что боцман сейчас находиться в коралловой лагуне (о. Синнабар > Сен-Аспир > Гавань > Песчаная тропа > Коралловая лагуна). Разговариваем с боцманом и отдаем ему флаг и он пропускает вас на корабль, там уже вас ждет Уильям . Говорит вам исследовать корабль и найти Кори и Нолана. Шаг 7. Идем в Грот-мачту, там сидит Ненуль который указывает Вам в сторону двух аквалангов(забираем их). Возвращаемся на палубу и идем в трюм, там находи Кори. Она рассказывает вам как их потопили пираты и держат в заложниках. Кори дает вам Глубоководный зуб на случай если придется перерезать веревки. Шаг 8. Возвращаемся на палубу, на которой происходит сражение. Уильям сошёлся в схватке с самим капитаном корабля, а пираты дерутся друг с другом. Вам нужно помочь Уильяму сразиться с пиратами. В трюме можно восстановить хп монстрам. Монстры пиратов: 658 Гиппотон, 141 Трелоби, 689 Рификус, 121 Батискафиш, 087 Хорвал, 395 Ирродель, 062 Грозель, 130 Дибарак. Шаг 9. После победы над всеми пиратами, Вы можете сходить в кубрик за Ноланом. Звуки сражения стихли. Но пираты перегородили вам выход из корабля. Заходим в каюту капитана, там находиться Уильям. Он победил капитана и теперь корабль принадлежит ему.  В качестве награды он дает вам 767 Вудлуз и отвезет Кори и Нолана обратно в восточный Джото. Вы так же можете поехать с ними, на раздумье у вас есть 2 часа",
