    "n": "Запись 1. У ледяной горы в северной части Селена встретила Мери. От нее сбежал Меррипик(Делибёрд). Бедная девочка, как она переживает за своего монстра. Что ж, нужно ей помочь. Ниже выписала правила игры с Меррипик(Делибёрд). Но для начала нужно попробовать его найти… (Мери находится Остарон - Маршрут 4 остров - Маршрут 3 остров - Лес Селена - Северный причал Селена - Маршрут 7 остров - Ледяная гора) Запись 2. Как удачно я зашла в старую хижину. Отшельник, что живёт в ней, оказался двоюродным дедушкой Мери. Он рассказал, что Меррипик(Делибёрд) стоит поискать на Плато, они там с Мери первый раз тренировались. Что ж, хорошая идея! /На каждой локации Меррипик(Делибёрд) принимает определенное угощение, которое добавляет ему камушки для жонглирования (У меня он был на пастбище, там он принимал орехи и на плато, где брал траву). После того как камушек стало 10 Меррипика(Делибёрд) нужно давать ТОЛЬКО леденцы что бы довести его до 3 маршрута/ Запись 3. Ну вот и все, наконец-то Меррипик(Делибёрд) вернулся к Мери. Как же они оба были счастливы! Девочка дала мне в благодарность Приманку, интересно сшитую куклу. По словам Мери, с помощью приманки я смогу поймать некоторых редких монстров, один из них - Меррипик(Делибёрд), что обитает на Плато. А пока мне нужно немного отдохнуть и набраться сил для новых открытий и путешествий!",
