    "n": "Запись 1. В центре Целадона находится здание метеостанции. Удачно же я туда зашла! Кроме того, что мне рассказали не только о работе метеостанции (здесь изучают погодные явления и пытаются их контролировать при помощи #351 Веттерино(Кастформов), но и об особенности влияния погоды на поведение монстров во время битвы, что может мне пригодиться. Постаралась всё запомнить... В крайнем случае, ведущий метеоролог всегда рад об этом рассказать. К слову, меня попросили, в случае если я замечу странные изменения погоды «точечного характера» (интересно, это термин или буйная фантазия метеоролога?!), сообщить о них сотрудникам метеостанции.   Маршрут 8 /погода град, прибор Снегомер/ Маршрут 11/погода песчаная буря, прибор Сейсмограф/ Маршрут 12/погода дождь, прибор Плювиограф/ Маршрут 19/погода солнечно, прибор Гелиограф/.  Стоимость одного прибора 250к, после сдачи Веттерино(Кастформа) на метеостанцию прибор исчезает) Запись 2. Когда на улице хорошая погода, встретить человека в зимней одежде практически нереально. А я вот встретила! Смешно очень, только если не вдаваться в подробности: Намби попал в сильный буран с градом на 8-ом маршруте! Может, это и есть один из тех погодных сбоев, о которых говорил ведущий метеоролог?.. Запись 3. Как я и предполагала, проблемы встреченного мною тренера связаны с теми погодными изменениями, о которых говорил ведущий метеоролог. Больше того, именно работа метеостанции стала источником этих явлений. Метеорологи недосмотрели за исследуемыми ими Веттерино(Кастформами), и один из них отправился в своё маленькое кастформ-путешествие с экспериментами! Что ж, придётся ловить. Показания прибора: зафиксирована деятельность Веттерино(Кастформа).  Запись 4. Веттерино(Кастформ) пойман и возвращён в метеостанцию. Надеюсь, за ним будут следить тщательнее. Хотя намёк ведущего метеоролога... Впрочем, может оказаться только намёком! Получила от метеоролога предметы, влияющие на погоду во время боя... Что ж, надо будет подумать, как их выгоднее применить.",
