    "n": "Запись 1. Встретила какого-то неадекватного клоуна Фредди в Шатре Вермилиона. Его выгнали из цирка Фарради, поэтому Фредди загорелся идеей создать свой собственный цирк. Что ж, мне пообещали награду, хотя дуэт клоуна и его Арлекида меня смутил. Вручили перечень атак и названий монстров для шоу четырёх стихий. Он также обмолвился, что нужно будет найти артистов для цирка, но сначала необходимо принести монстров. Монстры, которых мне нужно передать клоуну: Армурена(Клойстер) с атакой Морская вода Драуз(Сидра) с атакой Гидропомпа Огнепси(Гроули) с атакой Пламенный штурм Ракода(Вульпикс) с атакой Блуждающие огни Фоуль(Ноктаул) с атакой Рассекающий ветер Грюмышь(Голбат) с атакой Акробатика Потат(Диглет) с атакой Дрожь земли Скуллозавр(Маровак) с атакой Костолом   /За это мы получаем крепкий кофе х1/ Запись 2. С монстрами покончено. Фредди начинает действовать мне на нервы. Он предоставил список имён артистов, которых необходимо завербовать в новый цирк. Хорошо, что все они находятся в Канто. Ничего себе «пара профессионалов», да тут одних гимнастов больше будет! Список имён артистов, которых нужно пригласить выступать в цирке после сдачи монстров: - Гимнасты.(Восточный Шафран с 08:00 до 23:00. Говорим с тренером потом с гимнастами после этого они уходят в цирк) - Дрессировщик цирковых монстров.(Фуксия, выбиваем на пирсе из Шримпера его талисман) - Заклинатель Гюрзаров.(Маршрут 13, на 11 маршруте ловим сбежавшего Гюрзар 75лвл/включаем диких монстров, нажимаем на кнопку с надписью Гюрзар и ждем пока нападет. После поимки он окажется в питомнике/ и отдаем заклинателю) получаем ядовитый шип х1 и возможность его дропа. Идем в цирк и получаем награду.: Возможность ловли двух монстров из четырех: Капель, Скафиш, Тюлон, Хорсилт Запись 3. Фредди очень рад успешному завершению подготовки цирковых номеров. В благодарность за помощь он поделился со мной информацией об ареале обитания двух водных монстров. Полезная информация! Как-нибудь обязательно загляну посмотреть на новые представления в этом цирке.",
