    "n": "Запись 1. (Остарон - Маршрут 8 остров - Исследовательский центр) Профессор Стэн из Научного Центра рассказал, что около 10 лет назад собрал группу ученых-исследователей для изучения монстров в их естественной среде обитания, но у них ничего не получалось. Тогда они выдвинули теорию о существовании Энергии острова - им оказался легендарный монстр Гласеогриф. Но экспедиция к месту гнездования Гласеогриф провалилась, часть группы пропала, проходы завалило. Я пообещала Стэну помочь довести его исследование до конца. Профессор рассказал о карте местности, которая поможет добраться до места гнездования Гласеогриф, правда она зашифрована, что очень плохо. Тем более Стэн упомянул о пещере, в которой есть наскальные рисунки, это может помочь найти легендарную птицу! Может, стоит сходить к Древней горе без карты?! Запись 2. Да уж, бессмысленно было идти к горе без подготовки, стоит заняться поисками всего, что необходимо для восхождения на Древнюю гору. Для того, чтобы попасть на Древнюю гору нужны карта и проводник. Нашла ценителя древностей недалеко от Сайрефа, он всё ещё очень хочет заполучить себе карту... Мне удалось поговорить с Мудрецом в Остароне, оказывается, карта у его брата! Но они не виделись уже долгое время, брат избегает общества из-за войны между Остароном и Сайрефом, ох уж эти политические распри! Нужно найти его. Брат мудреца ушёл по 4-му маршруту в сторону гор. Поищу его там.(Остарон - Маршрут 4 остров - Тропа - Хижина отшельника) Отшельник рассказал, что сбежал из города из-за разгорающейся войны, он не может смотреть на то, как рушатся города. Карту он держит у себя все эти годы, хотя она ему и не нужна, но отдать её так просто не намерен!  Что бы Отшельник отдал карту нужно пройти квест Как я и полагала, дедушка очень любит свою внучку, хоть и пробыл столько лет вдали от неё. Новость о Меррипик его несказанно осчастливила и он отдал мне карту. Ко всему прочему быстро засобирался и отправился в город к ней и брату. Как же приятно воссоединять семьи! Плюсик в карму! Смотритель(Остарон - Маршрут 5 остров - Перекрёсток - Маршрут 10 остров - Маршрут 11 остров - Пригород Сайрефа - Сайреф ) с удовольствием позаботится о монстре, но у него сейчас так много работы, что максимум, на который я могу рассчитывать по времени нахождения Пантигр в питомнике, - 24 часа, надо торопиться! Или придётся снова относить Пантигр и клубок смотрителю... А теперь к Арчи! Запись 3. Мы нашли пещеру в Древней горе, о которой говорил профессор Стен! Даже изучили наскальный рисунок, который я набросал в дневнике, но следов пребывания Гласеогриф не обнаружили. Арчи предложил воплотить в жизнь то, что изображено на рисунке. А что? Чем чёрт не шутит, вдруг сработает! Видно, что для Арчи это в новинку, но он решителен, значит ему и проводить ритуал. Отдала Арчи монстров для ритуала. Попросил подождать несколько минут, пока он «колдует». Главное, не выходить из пещеры, а то придётся всё начать сначала... Запись 4. Ещё никогда я не радовалась простому кусочку сухого льда! Арчи воспользовался им, и всё сработало! Мы вызвали Гласеогриф! Правда, он напал на нас, и пришлось вступить с ним в бой, после чего он улетел, и больше мы его не видели... Но во время боя монстр обронил перо, и теперь у меня есть неопровержимое доказательство существования Гласеогриф! Оу! А что это с Арчи?! Он белее снега. Надо бы привести его в чувство и вывести к крутому подъёму. Пора рассказать профессору Стэну о находке! Он должен оценить масштаб открытия по достоинству. Запись 5. Профессор невероятно рад известиям, я даже испугалась, а не сошел ли он с ума от радости?! Но, кажется, все обошлось. Он так хвалил меня, сказал, что никому не удавалось сделать это раньше, теперь профессор немедленно приступит к изучению пера, я уверена, что теперь он разгадает загадку острова Селен. В награду проф.Стен пообещал обучать моих монстров одной атаке. Теперь я героиня острова Селен, и обо мне все будут говорить, шептаться на каждом углу и быть может даже слагать целые легенды! Ах, мечты-мечты..",
    "tp": "Text",
