    "ii": 451,
    "n": "После первого разговора со Стивом необходимо подождать 3 дня, а затем снова подойти в Фан-клуб. К тому времени Стив вернётся вместе с Джудит. Поговорите с Джудит, а затем со Стивом, далее следуйте инструкциям в дневнике. Для прохождения вам понадобиться: 1) Лечебная трава х25 2) Лазуриты х5 3) Камни Оникса х2 (или 200т)   Запись 1. В фан-клубе монстровв в Вермилионе очень уютно и спокойно. Однако, практически везде - плюшевые игрушки монстров. Много лет их собирает работница фан-клуба, Джудит. Мне стало интересно, какая же игрушка была первой в коллекции. Странно, но Джудит так и не смогла найти ту самую игрушку Эстерелла(Клефейри)... Запись 2. Стив, завсегдатай фан-клуба, рассказал о странном поведении его дочери Люси: всегда весёлая Люси всегда с радостью приходила в фан-клуб, где играла с куклами из коллекции Джудит, потом бежала играть с Мукун(Мяутами) в окрестностях Вермилиона, но с недавнего времени она резко переменила привычки и, по словам Стива, \"избегает фан-клуб\"... Надо бы поговорить с Люси. Может, она знает, куда запропастилась кукла Эстерелла(Клефейри). (Люси - 18й маршрут -> Кирпичный мост -> Под мост. Выбить и отдать Люси Синий бант х1 из Мукун(Мяута) Маршрут 11) Запись 3. Оказывается, Люси избегает разговоров с отцом, потому что потеряла любимую куклу Джудит. Что ж, вперед на поиски! Девочка рассказала жуткую историю, когда она возвращалась из Фан-клуба в Фуксию, на нее напал какой-то монстр, описанный ею как \"монстр\", причем Люси еще повезло, этот таинственный \"монстр\" отвлекся на брошенную куклу, принялся рвать ее, так что девочке удалось сбежать. Мне кажется, что нужно всё как следует изучить на этом пути, проверить каждый маршрут, надо дождаться и выследить обидчика! (Выбить Порванную куклу х1 из Райхорн. Для каждого тренера случайный маршрут из списка: 11,12,13,14,15 ) Запись 4. Монстр - это Булавир(Райхорн)! Он, действительно, оказался крайне недружелюбным монстром. Но мне всё же удалось отобрать куклу у него. Она сильно изорвана. В таком виде её нельзя возвращать Джудит. Это разобьёт ей сердце. Попробую найти того, кто сможет её привести в порядок. Запись 5. Портниха взялась зашить куклу, ей понадобится около дня на всё про всё. NB: Портниха живёт в доме с Иглой в западной части Шаффрана. (Через 20 часов кукла будет зашита. За куклу ей нужно принести Лечебную траву х25. После того как кукла будет у вас, нужно поговорить с портнихой) NB: Каменщик был замечен на 10 маршруте, недалеко от горного тоннеля в светлое время суток. (Для глаз понадобиться 2 Лазурита, в оплату 200к или 2 Камня Оникса . Приходим к портнихе и она пришивает глаза) Запись 6 Наконец-то кукла у меня и выглядит как новенькая! У портнихи золотые руки. Нужно как можно скорее обрадовать Люси и Джудит! Запись 7. Джудит просто вне себя от радости: первая кукла из её коллекции снова на месте! Как оказалось, Люси всё рассказала Джудит. Надеюсь, Люси станет снова чаще появляться в Фан-клубе и не будет так бездумно уносить кукол. Подарком от Люси оказался Лунный камень. А также в моей коллекции появилась интересная вещица: НМ - Вспышка. Надо бы найти ей достойное применение.",
