    "n": "Запись 1. Заглянула в лабораторию профессора Свота и, как оказалось, не зря: узнала, что некоторые ТМ-атаки можно получить из натуральных компонентов. Выписала списки необходимых ингредиентов. Однако, профессор готов сделать для меня лишь одну из атак.. Какую же выбрать? Ингредиенты для ТМ и Группы А: - Горсть кристаллов х10 - Волосок редлика х15 - Магнитная гайка х10 - Угольки х7 Ингредиенты для ТМ из Группы Б: - Лист булита х5 - Волосок редлика х10 - Угольки х7 - Споры Листотела х7 Как получить: - Волосок Редлика можно найти практически в любом регионе. - Споры Листотела чаще всего находят в Восточном Джото. - Угольки находили в Восточном Джото, там, где обитают Эфон. - Магнитные гайки обычно находят в скоплениях Октаселл, в Канто. - Лист Буллита можно найти на месте обитания этих монстров, в Канто и на Селене. - Горсть кристаллов - редкий ингредиент, его обычно находят на Селене, в местах обитания Снолинг.",
    "tp": "Text",
    "tx": "Запись 1.\r\nЗаглянула в лабораторию профессора Свота и, как оказалось, не зря: узнала, что некоторые ТМ-атаки можно получить из натуральных компонентов. Выписала списки необходимых ингредиентов. Однако, профессор готов сделать для меня лишь одну из атак.. Какую же выбрать?\r\n\r\nИнгредиенты для ТМ и Группы А:\r\n- Горсть кристаллов х10\r\n- Волосок редлика х15\r\n- Магнитная гайка х10\r\n- Угольки х7\n\r\nИнгредиенты для ТМ из Группы Б:\r\n- Лист булита х5\r\n- Волосок редлика х10\r\n- Угольки х7\r\n- Споры Листотела х7\n\r\nКак получить:\r\n- Волосок Редлика можно найти практически в любом регионе.\r\n- Споры Листотела чаще всего находят в Восточном Джото.\r\n- Угольки находили в Восточном Джото, там, где обитают Эфон.\r\n- Магнитные гайки обычно находят в скоплениях Октаселл, в Канто.\r\n- Лист Буллита можно найти на месте обитания этих монстров, в Канто и на Селене.\r\n- Горсть кристаллов - редкий ингредиент, его обычно находят на Селене, в местах обитания Снолинг.",
