    "n": "Запись 1. А остров-то только с виду кажется холодным – борьба тут между городами очень горячая! Мэр Сайрефа хоть и мечтает насолить мэру Остарона, но не знал о готовящихся действиях со стороны последнего. Думаю, я правильно поступила, что все рассказала. Мэр отправил меня к своему секретарю, возможно, у него появится какая-нибудь идея. Нужно проучить мэра Остарона! (В остароне разговариваем с Мэром берем у него задание разрушить снеговики. Идем в Сайреф рассказываем об этом Мэру, говорим с его секретарем. Ловим 10 Клуббиш (оддишей) и качаем их до Амбрук(Глума) с атаками: Ядовитая, парализующая, сонная пыльца и наговор. Отдаем их Крису который находится в Остароне. Всех монстров он заберет БЕСПЛАТНО.) Запись 2. Оказалось, что Остарон направил своего человека, Криса, для изучения монстров в Сайрефе. Но он не справляется со своими обязанностями, слишком уж рассеян и неопытен. Секретарь очень недоволен им, думает отравить назад, в Остарон. Но я узнала одну интересную деталь, если Крис берет на себя заботу сразу о нескольких монстров, то начинает допускать серьезные ошибки. Вот и решение проблемы, Остарон накажет сам себя! Крис неосознанно подставит весь город из-за своей невнимательности! Секретарь предложил нам расквитаться с Остароном довольно хитрым способом: надо поручить Крису около 10 Амбрук(Глумов) с очень неприятными атаками-пыльцой: сонная, парализующая и ядовитая, а также наговором на десерт. Юный покевод просто не уследит за таким количеством покемонов одновременно! Вот уж смеху-то будет, когда все Амбрук(Глумы) разбегутся по городу и познакомят жителей Остарона с характерными их сущности атаками! Ура! ​Дело сделано! Десятый и последний Амбрук(Глум). Ох, от их \"аромата\" пробъёт любой заложенный нос. Так что Остарон не спасёт ни один противогаз мира, с конкурентами покончено раз и навсегда, не сомневаюсь в этом! Ох, вот это вонь! Не могу больше здесь находится ни секунды. Нужно рассказать все мэру Сайрефа и обрадовать его! Запись 3. Слухи о подпорченной репутации Остарона уже достигли Сайрефа. Мэр поблагодарил меня, а еще рассказал несколько новостей: Крис, тот самый монстровод, занимающийся особыми тренировками монстров, способными изменить характер, готов сделать скидку в 50% для меня, если обращусь за его услугами.   А еще мэр рассказал по секрету, что неподалёку от Остарона можно встретить стадо пасущихся Элкас(Торосов), главное, не попадаться лишний раз мэру Остарона на глаза. По словам мэра, из Эстерелла(Клефейри) иногда выпадает собранная ими серебряная пыль. Это может мне пригодится.Отдохну и обязательно попробую воспользоваться. А потом отправлюсь к новым приключениям!",
    "tp": "Text",
