    "n": "Шаг 1. Идём в лес Селена и разговариваем с Искателем приключений. Он сказал, что ищет Триораптоса. Здесь! Ещё поведал о легенде «Драконьего глаза».   Шаг 2. Берём монстра с атакой Сила мысли и идём в логово дракона (Маршрут 4 остров > Маршрут 3 остров > Лес Селена > Северный причал Селена > Маршрут 7 остров > Ледяная гора > Логово дракона). Монстр просит вас отыскать артефакт   Шаг 3. Идём к Ценителю древности он рассказывает о Густаве и его семье, а так же отправляет вас к его правнуку.   Шаг 4. Идём в бар \"Ледокол\" и разговариваем с Сайманом, за информацию он просит 1кк.   Шаг 5. Едем в Канто и идём в \"Карамельные змейки\" (Маршрут 6 > Западный Шаффран > Восточный Шаффран > Кондитерская > Мармеладная площадь > Ванильная улица > «Карамельные змейки») разговариваем с Лерни. Вторую часть шифра он просто так не расскажет, нужно пройти его испытания 1) Принести 5 леденцов(Выбить нужно самому) 2) Принести монстров с 50, 90 и 150 показателями счастья   Отдаем все необходимое Лерни и он рассказывает свою часть загадки  Шаг 6. Идём на маршрут 9 в руины древнего храма -> комната настоятель. Резной потолок - Cui ridet Fortuna. Подсвечник - 3124 Книжная полка - ключ   Далее идём в поцарапанную дверь и открываем ключом дверцу письменного стола.  Вводим код: третий ящик, первый ящик, второй ящик и четвёртый Переходим в зал для молитв, активирует рычаг, потом идём в жертвенный алтарь. Нужно победить всех Рондар , Аспер что бы активировать алтарь   Шаг 7. Едем на Селен -Мудрец направил меня к Леркенсу! (Маршрут 5 -> перекрёсток) Информацию от него вы получите если выполните три задания: - Принести 10 штук Брони. - Сдать на изменение характера или поднятие генокода 5 монстров. - Отнять Лазерный диск у особенного Серберноса.  После выполнения заданий Леркенса указал путь к Кайле. Идём в снежную нору ( Маршрут 4 > Маршрут 3 > Лес Селена > Северный причал Селена > Заброшенная дорога > Маршрут 18 > Покрытая льдом тропа > Снежная нора) Пишем код Cui ridet Fortuna и оказываемся в секретно проходе.  Получаем подсказку от стража ловкости.   Шаг 8. Едем в Западное Джото идём к фонтан, нажимаем на послание. После идём на каменную площадку разговариваем с Анжелой. Узнаем про некий лабиринт. Как в него попасть она не знает и отправляет вас к Харви (Маршрут 2).  Просто так он ничего говорить не станет просит вас выполнить задания: - принести 5 мастерболлов - пройти квест исследование вулкана   После выполнения заданий Харви рассказывает об условиях, что бы пройти в лабиринт нужно сдать(заберут насовсем) Скорпимера, Мантеджа, Орламора   Шаг 9. Заходим в лабиринт (Маршрут 1) на входе сдаём монстров, бродим по локация пока не находим что-то вроде лаза, там встретите стража, скажите ему пароль. Переходим в границу, что бы попасть в сокровищьницу нужно первого нпс защекотать и тогда пройти мимо второго. В сундук забрать 1.000.000 и око мироздания. На выходе из лабиринта вас ограбит Анжела.   Шаг 10. Идём в полицейский участок разговариваем с офицером Джекки. Ждём 10 минут и снова говорим с Джекки. Разговариваем повторно, узнаем что Анжела уже уехала в Восточный Джото, следуем за ней   Шаг 11. Едем в Восточный Джото, разговариваем с офицером Джесс(площадь), она просит у вас зелье памяти, что бы допросить воровку. Анжела находиться на небольшом озере, приводим туда офицера Джесс. Вам отдадут око   Шаг 12. Едем на Селен и разговариваем с Триораптосом",
    "tp": "Text",
