    "n": "Запись 1. В музее истории Эстайр сити беда: каждый год там проводится грандиозная выставка фигурок монстров, где главной достопримечательностью является очень старая статуэтка Несси(Лапрас) и её украли! Выставка может сорваться. Нужно выяснить, что же случилось. Не буду отвлекать смотрителя музея, он всё рассказал офицеру Дженни, у нее и спрошу. Запись 2. По сведениям офицера Дженни, к краже причастен известный коллекционер древностей (пригород г.Сайреф. ), но улик нет. Стоит попробовать поговорить с ним, может, мне он скажет то, чего не расскажет полиции... (Говорим с ценителем древности, он просит отвезти посылку Сюарту. Едем в ВД, мастерская в старом районе г.Голденрод.) Запись 3. Статуэтка Несси (Лапраса) действительно находится у этого коллекционера и он этого не скрывает! Однако, чтобы мне ее получить, придётся ему помочь: доставить посылку мастеру Стюарту. Интересно, что в ней - очередная украденная ценность, мешок денег?! (После того как посылка отдана Стюар просит принести ему 5 металлических и каменных пластинок. Выбиваются:Площадь - Новый район - Дорога №1 - Горный перевал - Олстон - Безлюдная дорога - Скалы) Запись 4. ... Да он ... Как так??? ... Арр!!!11 Ох, в общем, Стюарту нужно по 5 металлических и каменных пластинок, которые можно достать в местах обитания Грошар и Феромор(Стиликсов и Аггронов). Загвоздка в том, что они крайне сильны и одолеть их будет не так уж и просто. Запись 5. Достать эти пластины было нелегко, но задача выполнена! И всё, что я получила - это очередное задание, доставить письмо ценителю древностей. Что ж... Обратно на Селен. (Отдаем письмо ценителю и он возвращает статуэтку, отдаем ее в музей) Запись 6. Отлично, статуэтка у меня. Скорее в музей, нужно обрадовать смотрителя! Запись 7. Статуэтка Несси (Лапраса) на своем законном месте, теперь ничто не помешает музею открыть ежегодную выставку фигурок! Не сомневаюсь, что она пройдет с невероятным успехом.",
