    "tx": "Запись 1.\r\nВ музее истории Эстайр сити беда: каждый год там проводится грандиозная выставка фигурок монстров, где главной достопримечательностью является очень старая статуэтка Несси(Лапрас) и её украли! Выставка может сорваться. Нужно выяснить, что же случилось. Не буду отвлекать смотрителя музея, он всё рассказал офицеру Дженни, у нее и спрошу.\r\n\r\nЗапись 2.\r\nПо сведениям офицера Дженни, к краже причастен известный коллекционер древностей (пригород г.Сайреф. ), но улик нет. Стоит попробовать поговорить с ним, может, мне он скажет то, чего не расскажет полиции...\r\n\r\n(Говорим с ценителем древности, он просит отвезти посылку Сюарту. Едем в ВД, мастерская в старом районе г.Голденрод.)\r\n\r\nЗапись 3.\r\nСтатуэтка Несси (Лапраса) действительно находится у этого коллекционера и он этого не скрывает! Однако, чтобы мне ее получить, придётся ему помочь: доставить посылку мастеру Стюарту. Интересно, что в ней - очередная украденная ценность, мешок денег?!\r\n\r\n(После того как посылка отдана Стюар просит принести ему 5 металлических и каменных пластинок. Выбиваются:Площадь - Новый район - Дорога №1 - Горный перевал - Олстон - Безлюдная дорога - Скалы)\r\n\r\nЗапись 4.\r\n... Да он ... Как так??? ... Арр!!!11\r\nОх, в общем, Стюарту нужно по 5 металлических и каменных пластинок, которые можно достать в местах обитания Грошар и Феромор(Стиликсов и Аггронов). Загвоздка в том, что они крайне сильны и одолеть их будет не так уж и просто.\r\n\r\nЗапись 5.\r\nДостать эти пластины было нелегко, но задача выполнена! И всё, что я получила - это очередное задание, доставить письмо ценителю древностей. Что ж... Обратно на Селен.\r\n\r\n(Отдаем письмо ценителю и он возвращает статуэтку, отдаем ее в музей)\r\n\r\nЗапись 6.\r\nОтлично, статуэтка у меня. Скорее в музей, нужно обрадовать смотрителя!\r\n\r\nЗапись 7.\r\nСтатуэтка Несси (Лапраса) на своем законном месте, теперь ничто не помешает музею открыть ежегодную выставку фигурок! Не сомневаюсь, что она пройдет с невероятным успехом.",
