    "h": 760,
    "ii": 1127,
    "n": "Шаг 1. Начать квест можно поговорив с НПС на локации “Крутой Подъем”. Шаг 2. Пойти в мэрию в Остароне/Сайрефе. Поговорить с Секретаршей. Шаг 3. Поговорить с Мэром на локации (Маршрут 4 > Провал)/(Маршрут 13 > Логово Демотов). Шаг 4. Победить 15 Эстрелл/Демотов на той же локации где и говорили с мэром. #035 Эстерелла 80-85 лвл (Колыбельное, Уменьшение, Метеор, Пробуждающий удар)/#215 Демот 80-85 лвл (. Лучше использовать монстра с насмешкой + огни . Из локации выходить НЕЛЬЗЯ!! В конце надо победить босса #036 Астерелла 100 лвл. Шаг 5. Говорим с мэром на локации. Он попросит прийти к нему через 30 минут в мэрию. Шаг 6. Пойти на локацию “Пастбище” поговорить с грустным стариком. Он попросит принести ему Элкаса со способностью яростный взгляд. Шаг 7. Идем говорить с мудрецом. Его можно найти в Остароне. Ответы на вопросы: Трелоби (Остарон); Булавор (М13); - Кларина(М16); Сербернос (Лазурная заводь); Темный импульс(Пастбище); Хронокон(Горный водопад) Шаг 8. Идем в Сайреф. Говорим с мудрецом, Крисом, Рей и Фредом. Шаг 9. Идем на локацию берег. Ответы: если на грудь, то ответ назад. Если на правый бок, то ответ левый. Другими словами выбираем противоположный ответ. Шаг 10. Начинают нападать Пургетты 100 лвл (Используйте Реззуру, следите за путами) надо убить 6-8 штук. Шаг 11. Ждем указанное время и идем на локацию “Крутой подъем” Шаг 12. Получаем приз.",
    "tp": "Text",
    "tx": "Шаг 1. Начать квест можно поговорив с НПС на локации “Крутой Подъем”.\r\n\r\nШаг 2. Пойти в мэрию в Остароне/Сайрефе. Поговорить с Секретаршей.\r\n\r\nШаг 3. Поговорить с Мэром на локации (Маршрут 4 > Провал)/(Маршрут 13 > Логово Демотов).\r\n\r\nШаг 4. Победить 15 Эстрелл/Демотов на той же локации где и говорили с мэром. #035 Эстерелла 80-85 лвл (Колыбельное, Уменьшение, Метеор, Пробуждающий удар)/#215 Демот 80-85 лвл (. Лучше использовать монстра с насмешкой + огни . Из локации выходить НЕЛЬЗЯ!! В конце надо победить босса #036 Астерелла 100 лвл.\r\n\r\nШаг 5. Говорим с мэром на локации. Он попросит прийти к нему через 30 минут в мэрию.\r\n\r\nШаг 6. Пойти на локацию “Пастбище” поговорить с грустным стариком. Он попросит принести ему Элкаса со способностью яростный взгляд.\r\n\r\nШаг 7. Идем говорить с мудрецом. Его можно найти в Остароне. Ответы на вопросы:\r\n\r\nТрелоби (Остарон);\r\nБулавор (М13);\r\n- Кларина(М16);\r\nСербернос (Лазурная заводь);\r\nТемный импульс(Пастбище);\r\nХронокон(Горный водопад)\r\n\r\nШаг 8. Идем в Сайреф. Говорим с мудрецом, Крисом, Рей и Фредом.\r\n\r\nШаг 9. Идем на локацию берег.\r\nОтветы: если на грудь, то ответ назад. Если на правый бок, то ответ левый. Другими словами выбираем противоположный ответ.\r\n\r\nШаг 10. Начинают нападать Пургетты 100 лвл (Используйте Реззуру, следите за путами) надо убить 6-8 штук.\r\n\r\nШаг 11. Ждем указанное время и идем на локацию “Крутой подъем”\r\n\r\nШаг 12. Получаем приз.",
