    "h": 700,
    "ii": 1189,
    "n": "Запись 1. В монстроцентре Вархолла мне встретилась девочка-тренер по имени Ленор, она проходит лечение у Сестры Джей. Она рассказала, что под окном её палаты появился таинственный певец, благодаря которому ей удалось уснуть, несмотря на боль в ушибленной ноге. Она просит найти его, но у меня нет никаких идей, кто бы это мог быть. Надо поговорить с окружающими, может быть, кто-то что-то знает? В первую очередь стоит спросить тех, кто также мог слышать эту мелодию. Пойду-ка в монстроцентр! Запись 2. Сестра Джей из монстроцентра Вархолла сказала, что, скорее всего, таинственным певцом был какой-то дикий монстр. Что ж, думаю, тех, кто способен усыпить песней, не так-то много. Должно быть, речь идет о специфической способности монстра, “Колыбельной”. Кто не спрятался - я не виновата! (Нужно принести Ленор 5 монстров с атакой колыбельная) Запись 3. Как странно! Я приносила ей самых разных монстров, которые знают Колыбельную, но ни один из них не подходит. Надо бы поговорить со знающими людьми, может быть, я что-то упускаю? Спрошу Сестру Джей, может, у неё появились какие-то идеи после постоянных расспросов Ленор! Запись 4. Мне посоветовали найти жуколова Кристи, надеюсь, она знает, кого и где мне искать! (Дорога №3) Запись 5. Кристи действительно смогла мне помочь! Она сказала, что тот монстр, которого я столько времени ищу, водится в полях возле третьей дороги. Благодаря ей это место будут чаще посещать виновники переполоха. Осталось притаиться и дождаться этого таинственного исполнителя колыбельной. Что ж, буду держать монстробол наготове! Запись 6. Ленор узнала в Лалабир(Крикетоте) того самого певца! Она очень рада новому другу. Сестра Джей поблагодарила меня за содействие набором витаминок для моих питомцев! Стоит почаще приходить на третью дорогу за Лалабир(Крикетотами).",
