    "n": "Шаг 1. Идём к ветерану, разговариваем про бой гим лидера и Сторна. На середине рассказа он просит принести Грандира что бы тот его грел. Отдаем монстра и ветеран продолжает рассказ. В конце просит принести Амперона. Ветеран рассказывает вторую историю и не может вспомнить имя второго претендента, просит вас принести журнал со стадиона где записаны все имена.   Шаг 2. Берём монстра знающего атаку обнаружение идём на заросшую трапу, появляется локация скрытая тропа. Нажимаем на заброшенный стадион. Пытаемся убрать валун(когда появится запись: использовать металлическую пластину в качестве рычага) выбрать её и проход будет открыт. Порыв ветра разбросал листы из журнала и дикие монстры их утащили. Выбиваем из Крыскуна книгу. Отдаем ветерану первую книгу, она оказалась слишком старой. Выбиваем следующую из Малоров. Отдаем ветерану и эта книга тоже не подходит, бьём третью из Амбруков, отдаем ветерану. Узнаем нужное имя и едем на Селен.   Шаг 3. Идём в Сайреф ->Маршрут 13-> Маршрут 17- извилистая тропа - берег - отмель там находим Филиппа(каждый день с 10 до 15 часов). Он предложит вам сразиться с ним 6 на 6, во время боя покидать локацию нельзя. Его монстры: #169 Крестопырь, #604 Три-о-Клокс, #625 Капканг, #531 Мулму, #226 Скайт, #257 Фанагал. После победы над ним он попросит принести сухой лёд х10 и #291 Ассосу что бы сделать подарок для ветерана.   Шаг 4. Приносим все что просил Филипп и получаем статуэтку, он просит о повторном бое (6х6, выходить с локации нельзя, монстры те же). Если проиграли, повторить можно через 2 часа. После победы у вас из рюкзака падает статуэтка и разбивается, Филипп предлагает сделать ещё одну из более прочного материала и просит принести ему Осколки силверсита и горсть кристаллов. Отдаем все Филиппу и получаем статуэтку, так же в награду он даёт тм на выбор (тм 06- отравление, тм 12- насмешка, тм 61- блуждающий огни, тм 73 - электрошок).   Шаг 5. Возвращаемся в Восточный Джото и отдаем статуэтку ветерану. На огненном стадионе вас ожидает его сын Эрик, идём к нему. Он просит провести бой на 40лвл 1х1 и для этого даёт вам карптарха и 2 набора конфет (при проигрыше повторить попытку можно через 2 часа). В награду за победу Эрик предлагает вам выбор оставить этого Фанагал(не передаётся, спарен, ген 26, хар непреклонный или весёлый) или взять карптаха(передаваем, не спарен, выше ген, хар случайный). Идём к ветерану   После прохождение квеста доступна локация опушка.",
