    "n": "Запись 1. Гуляла по лесу вокруг воздушного стадиона в окрестностях Голденрода. На небольшой опушке наткнулась на старичка в окружении травяных покемонов #047 Листвотел, #465 Лознудль, #192 Бушрут и #071 Буллитум(#047 Парасекта, #465 Тангроуз, #192 Санфлоры и #071 Виктрибела). Все его зовут дядюшкой Бриджем. Увлекательная история его жизни окончилась небольшой просьбой: помочь собрать всех травяных покемонов, обитающих в Восточном Джото, кроме тех, что можно встретить только в болотах, чтобы он сам мог их воспитать. Думаю, что это не потребует особых усилий и я смогу ему помочь. Отдала дядюшке Бриджу нескольких травяных покемонов: Клуббиш(#043 Оддиш) Пикан(#331 Какнея) Стинни(#546 Каттони) Бутастр(#406 Бадью) Дендино(#187 Хопип) NB: дядюшка Бридж гуляет по лесу с 10:00 до 20:00.",
