      "pr": "font-family: Montserrat;\nfont-size: 32px;\nfont-weight: 600;\ntext-transform: uppercase;\nletter-spacing: 0%;\n-pt-paragraph-spacing: 0;\nborder-width : 1px;\n-pt-border-position: outside;\nbackground-color: #000000cc;\n"
