    "n": "Запись 1. В центре Олстона раскинулся огромный цирковой шатёр. Разумеется, я поспешила туда! Но разочарованию моему не было границ: ожидала увидеть великолепное представление, а наткнулась только на постоянно плачущего маленького человека. По его рассказам, он директор цирка. Крайне нерадивый директор: в один прекрасный момент циркачи ушли от него, не выдержав его требований. Конечно, он сам виноват... Но в его взгляде было столько горечи и раскаяния, что я просто не смогла не согласиться ему помочь... Необходимо собрать как можно больше информации о старых цирковых представлениях.(Мэрия в Голдероне, но нужна библиотека в Канто, Сделать копию в библтотеке) Запись 2. Тут надо не забыть записать всё-всё, что удастся узнать! (Отдаем копии маленькому человеку. Он дает задания поймать монстров, количество и нужные атаки указаны. После отдаем их ему) Запись 3. Надо было видеть, как запрыгал от счастья маленький человек, когда я принесла ему всех монстров! По крайней мере, мне было весело. По его словам, на подготовку первого представления уйдёт не больше двух дней. Будучи почётным гостем, я приглашена на премьеру циркового шоу!(ожидаем несколько дней и приходим в цирк) Запись 4. Наконец-то цирк функционирует, как и прежде! Восстановленное представление будет невероятно красивым, по крайней мере, я в это верю! Мистер Фарради не остался в долгу... Теперь надо бы подумать, как выгоднее применить (Коготь), который за ненадобностью он отдал мне.",
