    "n": "Шаг 1. Идём в подлесок ( Новый район > Дорога №1 > Горный перевал > Олстон > Заросшая тропа > Глухой колючий лес > Подлесок). Разговариваем с Доктором Финсом, он занят своим делом, настаиваем на помощи и узнаем о том, что он хочет увидеть эволюцию Жаблифа и поймать себе одного. Он просит подождать час что бы составить план   Шаг 2. Возвращаемся спустя 1 час, он даёт вам рисунок с монстрами(могут отличаться) и атакам, которые потребуются : - Грути/Астрания с атакой Свирель - Баттинун/Баттнайти с атакой серебряный ветер (идём на маршрут 3 к Жуколову Кристи, за громовой камень вы получите Мувага) - Вьюнудль с атакой травяная арена - Листотел с атакой ароматерапия Отдаем всех монстров Доктору Финсу ждём до утра.   Шаг 3. Утром узнаем что эксперимент провалился, после разговора, доктор просит отправиться на Селен и найти Гаррисона   Шаг 4. Едем на Селен, идём на маршрут 18. Гаррисон отказывается помогать просто так и предлагает выбор поймать ему 221 Ленсерино либо шайни, либо гигантского. Выбрав шайни в награду вы получите корнецвет. Выбрав гигантского получите мешочек. Ловлю начинаете с указанной локации, он будет 100лвл(бьётся легко). Далее переходите на ту локацию, которая будет указана в записях в дневнике   Шаг 5. После поимки нужно Ленсерино идём к Гаррисону (горная деревушка) получаем награду 20 даркболов. Он начнёт говорить что хотел не Ленсерино, а Ленсирона и попросить у вас Эволвер Знаний. Если отказаться, он сообщит что данный предмет ему должен дать Ценитель древностей, отправляемся к нему   Шаг 6. Идём в пригород Сайрефа разговариваем с ценителем, его посылка пришла в Селен, но почтальон её не доставил. Просит разобраться с этим   Шаг 7. Идём в Сайреф разговариваем с посыльным Айваном. Он сообщает что посылку украли Пелисир. Что бы вернуть посылку нужно отвлечь птиц на раковину (даёт 2 штуки)   Шаг 8. Отправляемся на мыс. В углубление на скале кладём раковину и бьём Пелисиров(до 50лвл) пока не выпадет посылка. Отдаем посылку Айвану. Возвращаемся к Ценителю в награду получаем 2 Эволвера знаний  Шаг 9. Возвращаемся к Гаррисону и отдаем Эволвер. Обязательно расспрашиваем про историю и в награду получаем либо пыльцу , либо цветок и Гловера. Едем в Восточный Джото  Шаг 10. Разговариваем с Доктором, и он просит принести нужного монстра. Берём Гловера и идём на болото. (Главия нужна 19 лвл, иначе ничего не не получится). Отдаем нужного монстра Доктору, ждём до утра. Подходим к Доктору и узнаем радостные новости, все получилось и ваш приз ждёт вас в питомнике",
