    "n": "Запись 1. Прогулка по окрестностям Флауренции - весьма занимательно действие: сельская местность, поля, луга, обилие травяных монстров и монстров-жуков... Во время прогулки зашла на какую-то ферму в надежде попросить стакан воды. На краю фермы есть огороженная пасека. Испугавшие меня гул и беспрестанное жужжание, по словам фермера, производит рой Москилл, обосновавшийся на разорённой пасеке. Надо попробовать их оттуда прогнать! (На данном этапе Вам необходимо освободить пасеку от оккупировавших её диких Москилл. Для этого необходимо прогнать незваных гостей. Окончанием этого трудоёмкого процесса будут выбитые вами Старые соты х1) Запись 2. Мне удалось очистить пасеку от надоедливых Москилл! Теперь там только пустые улья и вот эти Старые соты. Наверное, надо их отнести фермеру. ( После того как Вы прогоните всех Москилл с пасеки, Вам предстоит ещё один разговор с Фермером, в ходе которого он попросит Вас помочь ему восстановить опустевший промысел. Для восстановления пасеки Вам понадобится сделать следующее: Раздобыть Хани х20 и Роялони х1. Для этого необходимо отправиться на Небольшую скалу в саваннах Западном Джото. Доступ к ловле Хани откроется сразу после просьбы Фермера. Принести Квестовый Мед х20 (Дроп из Роялони на Небольшой скале). Возвращаемся в Восточный Джото и отдаём всё найденное Фермеру. Ждём 24 часа.) Запись 3. Мне удалось собрать всё необходимое для восстановления пасеки. Странно, но Хани грустно летают вокруг Роялони и даже не думают собирать мёд, хотя и сад весь в цвету, и на полях распустились великолепные растения. Надо попробовать узнать, в чём дело. (Отправляемся на поиски решения проблемы. Ответ находим у дядюшки Бриджа, который начнёт с нами разговаривать только после выполнения Записи 1 квеста \"Несчастный Тропиус\".) Запись 4. Факт, поведанный дядюшкой Бриджем, заинтересовал не только меня. Фермер полагает, что стоит попробовать собрать команду из монстров, способных использовать Сладкую пыльцу. (Обрадованные хорошими новостями, возвращаемся к Фермеру. Пораздумав, он опять просит вашей помощи. На этот раз необходимо найти покемонов, знающие атаку Сладкая пыльца:Мандракас х5, Буллитум х5, Астрания х5. Ждём 24 часа, необходимые для окончательного восстановления пасеки. При следующем диалоге Фермер расскажет о наконец-то работающей пасеке и новом её обитателе - Джуснель, которого Вы можете ловить безо всяких преград) Запись 5. Ура! Травяные монстры сплотили Хани и теперь пасека работает, как прежде! Фермер рассказал, что аромат сладкой пыльцы привлёк на пасеку редких монстров-жуков... Надо будет там прогуляться!",
