    "n": "Запись 1. По дороге во Флауренцию встретила девушку - жуколова Кристи, которая поделилась со мной странной историей. Её подруга хочет провести свадьбу... монстров. Даже представить себе не могу это событие! Свадьба монстров… Как интересно! Попробую уточнить у девушки по имени Стефани, нужно ее найти. (Флауренция -> Оранжерея цветов) Запись 2. По рассказу Стефани, что оказалась в Оранжерее цветов Флауренции, церемония должна быть очень красивой. Но нужно помочь в организации, складывается такое впечатление, что она даже и не начинала готовиться! Бранзер(Сквиртл) Ричард, так зовут будущего жениха, ждёт меня на пляже в Фуксии. Его нужно привести в форму типовыми конфетами. Сколько их нужно - неизвестно. Стефани выбрала для него два костюма: «Крепкий панцирь» и «Суровый рокер». Для последнего не хватает деталей, можно попробовать подыскать что-нибудь, вдруг Бранзер понравится. Помимо этого нужно принести с десяток веток Чванши Стефани, но это потом... (Нужны конфеты водного типа, если в начале сквиртлу дать черные очки, конфет уйдет меньше. Количество конфет скормленных сквиртлу определяется рандомно) Запись 3. Готово! Бранзер наконец-то в нужной форме и готов к свадьбе! Пока он будет ждать невесту, отвезу ветки Чванши Стефани, заодно расскажу, как всё прошло. Запись 4. Ох уж эти Месьер, летят на все блестящее… Обидно за Стефани, она ведь так старалась для церемонии, а эти негодные птицы украли всё необходимое для свадьбы. Нельзя оставить её в беде. Попробую найти по короне и водному амулету жениху и невесте. (Принести 2 короны и 2 водных амулета) Запись 5. Вот теперь точно всё готово! Стефани пригласила меня на свадьбу и сказала, что меня ждет маленький Бранзер… Здорово! Поскорее отправлюсь в Канто, дабы ничего не пропустить! Церемония просто обязана выйти замечательной! Запись 6. Эх, обидно, успела лишь к концу церемонии. Но ничего, семья Бранзер выглядит счастливой, а это самое главное! Сколько радости было в их глазах! Запись 7. Свадьба монстров - это что-то невероятное! Возможно, когда-нибудь и у меня будет влюблённая парочка, для которой я с радостью организую подобную церемонию! Ах, мечты... Ах, да! Меня же ждет в питомнике новый малыш - Бранзер… Что ж, думаю, с ним у нас впереди ждёт много интересного! NB: Заросли Чванши есть в Канто.",
