    "n": "Запись 1. Зашла в Паб «Хаус», где встретила девушку, которая занимается выгулом питомцев, как хорошо, что еще есть люди, которые помогают старикам и ухаживают за их питомцами. Но, как оказалось, от нее сбежал один из них... Бедная Кайли, как она переживала об этом Мурысь, словно это ее собственный монстр.  (Ловим Мукуна с характером мягкий, прокачиваем до Мурыся 64 лвл.  Отдаём монстра Кайли, получаем награду: Даркболл х10, и Четырехлистник х1.) Запись 2. Это удивительно: воспитанный мной Мурысь оказался почти близнецом потерянному Кайли монстру. Наконец-то она улыбнулась и успокоилась, еще и игра с Мурысь ее успокоила… А не завести ли себе тоже кота? Как раз Кайли дала мне в знак благодарности Даркбол х10. И какую-то веточку... Похоже на Четырехлистник. Говорят, он приносит удачу. Что ж, она мне вполне не помешает!",
