    "ii": 2356,
    "n": "Запись 1. Институту Саммера нужны добровольцы для участия в исследованиях. Сейчас они изучают один из спящих вулканов Западного Джото, у которого был замечен всплеск небывалой активности. Если он проснётся, то уничтожит всё в радиусе свыше трёхсот километров. Я не смогла пройти мимо этой трагедии. Ведь, если регион пропадёт, то как же я соберу всех монстров, которые обитают только здесь! Мари отправила к Лаборанту за необходимым оборудованием. Запись 2. Лаборант был слегка напуган приближающейся возможностью извержения вулкана, но выдал мне всё, что нужно, не забыв даже инструкцию по применению. Вперёд к кратеру вулкана на сбор данных! Всего нужно: 3 образца породы и 5 образцов растений.  (Следуете за Лаборантом в Кратер вулкана на Вулканическом плато. Здесь вам предстоит собрать Образец породы х3.  Для этого неодходимо Нажать кнопку Собрать образцы породы (в строке Персонажи) и победить последовательно трёх покемонов, которые охраняют образцы (после победы над последним(третьим) покемоном вы можете покинуть локацию для того, чтобы полечиться; кроме того, чтобы собрать все три образца, необходимо каждый раз нажимать кнопку сбора образцов).  В боях за породу вам необходимо победить следующих покемонов: • Вулкемел 100х-?lvl, • Лавазавр 100х-?lvl • Огнекрыл 100х-?lvl Далее необходимо поговорить с Лаборантом, отчитаться о проделанной работе. Лаборант расскажет о том, что приближается огромный покемон, которого он хочет поймать.  Ваша задача на этом этапе обессилить покемона. После разговора нападёт Вулканозавр 100х-?lvl, которого необходимо победить.  Разговариваете с Лаборантом, который расскажет об удачной поимке. В инвентаре появится Покебол с Магмортаром х1. Лаборант попросит отнести покебол Мари и напомнит о том, что необходимо также собрать образцы растений.  Идёте на Вулканическое плато, где необходимо собрать Образец растений х5. Дроп образцов - из Фобрец. Относите собранные вещи Мари. Получаете награду)",
    "tp": "Text",
    "tx": "Запись 1.\r\nИнституту Саммера нужны добровольцы для участия в исследованиях. Сейчас они изучают один из спящих вулканов Западного Джото, у которого был замечен всплеск небывалой активности. Если он проснётся, то уничтожит всё в радиусе свыше трёхсот километров.\r\nЯ не смогла пройти мимо этой трагедии. Ведь, если регион пропадёт, то как же я соберу всех монстров, которые обитают только здесь!\r\nМари отправила к Лаборанту за необходимым оборудованием.\r\n\r\nЗапись 2.\r\nЛаборант был слегка напуган приближающейся возможностью извержения вулкана, но выдал мне всё, что нужно, не забыв даже инструкцию по применению. Вперёд к кратеру вулкана на сбор данных!\r\nВсего нужно: 3 образца породы и 5 образцов растений.  (Следуете за Лаборантом в Кратер вулкана на Вулканическом плато. Здесь вам предстоит собрать Образец породы х3.  Для этого неодходимо Нажать кнопку Собрать образцы породы (в строке Персонажи) и победить последовательно трёх покемонов, которые охраняют образцы (после победы над последним(третьим) покемоном вы можете покинуть локацию для того, чтобы полечиться; кроме того, чтобы собрать все три образца, необходимо каждый раз нажимать кнопку сбора образцов).  В боях за породу вам необходимо победить следующих покемонов:\r\n • Вулкемел 100х-?lvl,\r\n • Лавазавр 100х-?lvl\r\n • Огнекрыл 100х-?lvl\r\n\r\nДалее необходимо поговорить с Лаборантом, отчитаться о проделанной работе. Лаборант расскажет о том, что приближается огромный покемон, которого он хочет поймать.  Ваша задача на этом этапе обессилить покемона. После разговора нападёт Вулканозавр 100х-?lvl, которого необходимо победить.  Разговариваете с Лаборантом, который расскажет об удачной поимке. В инвентаре появится Покебол с Магмортаром х1. Лаборант попросит отнести покебол Мари и напомнит о том, что необходимо также собрать образцы растений.  Идёте на Вулканическое плато, где необходимо собрать Образец растений х5. Дроп образцов - из Фобрец. Относите собранные вещи Мари. Получаете награду)",
