    "n": "Запись 1. Побывала в доме у отца Милы - Альберта. Его брат Кристиан находится в очень тяжёлом состоянии, говорит про какую-то банду Феролема и бункер. Ничего не разобрать!  Дала 5 порций Мёда Альберту, чтобы привести его брата в чувство приготовленным из мёда снадобьем.  (Берем квест в Доме Альберта. Отдаем мёд ему и после разговариваем с Кристианом) Запись 2. Кристиан много рассказал о команде Феролема, да и теперь понятно, почему он так изнемождён (пытался пробраться на охраняемый объект - бункер на маршруте №3, если точнее). Там банда держит пленников, которых брат Альберта и пытался спасти. Более того, среди заточённых может находиться дочь Кристиана - Дафна. Девушка потеряла голову от любви к главарю банды - некоему Рикки, поэтому тоже могла оказаться в ловушке. Действительно запутанная история выходит. Я пообещала, что проберусь в бункер и спасу узников заброшенной лаборатории бункера.  (Берем с собой серьезных монстров и стимпаки, так как если уйти с локации, прохождения бункера начнется заново.) Запись 3. Точно известно, что Дафна и Рикки уехали на Селен. Кристиан порывался сам тут же отправиться в погоню за ними, но Альберт удержал брата. Так как они неспособны поехать туда, я сама вызвалась попытаться образумить Дафну. Мне посоветовали найти Мудреца и как следует расспросить его. Быть может, он подскажет, где скрывается Рикки. Намекнула Кристиану, что за эту услугу ему придётся поделиться со мной некоторыми секретами обращения с летающими монстрами. Ещё бы! Ведь он в молодости активно помогал бывшему лидеру Воздушного стадиона. Отправляюсь в путь прямо сейчас.  (В Селене общаемся с Мудрецом он направляет вас в сторону горной деревушки, там найдете хижину. Говорите с Дафной, приходит Рикки и после разговора с ним вы больше не можете зайти в хижину. Отправляемся к офицеру Джес) Запись 4. Поговорила с офицером Джес. Договорились, что я попробую внедриться в банду Феролема, но это очень рискованно и опасно. Вербовкой людей занимается Агрест, часто бывающий в баре Остарона. Надеюсь, что меня не раскусят.  (Идем в бар, разговариваем с Агрест, принимаем его просьбу принести лед. Отдаем лед и вас отправляют за заданием к Нейту. В первом задании используется монстр с чутьем.) Запись 5. Внедрение проходит достаточно успешно! Нейт презентовал мне Скобовое кольцо х1. Начало уже радует! Теперь мне подкинули ещё одну задачку - заморозить строительство полицейского участка в пригороде Сайрефа. Только вот как это сделать? Попробую опросить местных.  (Разговариваем с Ценителем древностей в пригороде Сайрефа. Отдаем ему монстра с градом, с Москилами \"нападаем\" на строителей.Отчитываемся о проделанном Нейту)   Нейт отдал Колокольчик х1 и отправил меня к Пэйри. Она будет в Сайрефе с утра до вечера. (Разговариваем с Пэйри, она дает очередное задание похитить монстроболл. Отдаем ей монстра с гипнозом. Ночью приходим в Хранилище антикварного дома и забираем монстроболл. Разговариваем с Пэйри, после отправляемся к офицеру Джес) Запись 6. Есть! Пэйри указала место тайника команды (в частном магазине Эстайр сити, прямо под носом у офицера Джес)! Там будет общий сбор банды, для входа мне придётся подать условный сигнал - три раза постучать и назвать цифры: 3, 7, 9. Нужно как можно скорее рассказать всё офицеру Джес, она, должно быть, снова находится в Эстайр сити.  (Едем в Западный Джото и разговариваем с Кристианом) Запись 7. Убедилась в том, что Кристиан - один из самых заботливых отцов. Принял непутёвую дочь, даже помолодел с виду. Он так благодарен мне за помощь! Так как Кристиан ещё не забыл, как проходил обучение у лидера Воздушного стадиона, мои планы не пошли крахом.",
