    "h": 1440,
    "ii": 2473,
    "n": "Запись 1. В Долине гейзеров встретила туриста, осматривающего достопримечательности. Парень рассказал мне, что недавно в саванне стали появляться Прайдоры, целый прайд! Находка для журналистов. Но монстры нападают на людей, в больницах находится много пострадавших. Как я поняла, некий мистер Гибсон сможет пролить свет на эту загадку. Он руководит ремонтными работами моста к саванне.  (Идём в долину гейзеров разговариваем с туристом. Идём в долину вечности, снова разговариваем с туристом, он попросит найти мистера Гибсона, который находится в Саммере) Запись 2. Мистер Гибсон оказался подполковником в отставке. Он сообщил мне важные сведения о последних событиях жизни прайда. Военный сейчас активно собирает информацию о причинах агрессии монстров. А мне необходимо отвезти Посылку профессору Нилсу в Восточный Джото. Запись 3. Выяснилось несколько причин агрессии прайда, а именно: пропажа вожака и его сына. Мистер Гибсон занялся поисками главы прайда, а мне выпала задача отыскать привезённого в восточную часть Джото Фрыкона, который вроде бы и является наследником. Профессор Нилс обеспокоен возможностью захвата прайда чужими монстрами. Если власть не захватили, то достаточно будет вернуть маленького Фрыкона, тогда нападения на людей прекратятся. Благодаря профессору Нилсу и его коллеге профессору Кармен удалось выяснить, что Фрыкона продали в цирк Олстона. Мне необходимо уговорить владельца цирка отдать монстра.  (Идём в цирк, разговариваем с директором, он согласен отдать фрыкона, но взамен мы должны вернуть его обручальное кольцо. Ловим волёк или световол с харом в а, качаем до 50 лвла(для атаки обояние).  Находим карманника в глухом колючем лесу(в подлеске), используем обаяние, он говорит, что потерял кольцо в глухом колючем лесу. Идём в лес, выбиваем кольцо(Дроп: с Лайкунов) и относим директору цирка, он отдаёт монстробол с фрыконом) Запись 4. Мистер Фарради в обмен на услугу всё же передал мне Монстробол с Фрыконом. Пойду обрадую профессора Кармен. Запись 5. Я буду сопровождать профессора Кармен и Фрыкона в Западный Джото. Она попросила меня сразу же передать Монстробол с Фрыконом лично в руки мистеру Гибсону. Запись 6. Мистер Гибсон щедро вознаградил меня за помощь в поисках Фрыкона: - Эволвер знаний; - Улучшенный набор витаминов; - Люксбол. Пришлись как нельзя кстати. Причём подполковник даром времени не терял: вожак прайда найден! Но рано радоваться - прайд захватил другой Прайдор, значит, старому вождю надо набраться сил и победить соперника в честной схватке. Только вот подвесной мост так и не отремонтировали, следовательно, на другую сторону не перебраться. Пойду поищу профессора Кармен, мистер Гибсон что-то говорил об офицере Джекки. Может быть, профессор сейчас рядом с ней. Расспрошу их обеих.  (Разговариваем с Джеки, она просит выбить лианы в каменном ущелье(Дроп: Робария) Отдаём лианы, ждём 10 часов) Запись 7. Выполнила просьбу офицера Джекки, которая ускорит проведение ремонта подвесного моста. Запись 8. Что ни день, то проблема! Старый вожак прайда попал в беду - его загнали в ловушку захватившие земли и семью чужаки, напали всем скопом! Коварство процветает в пустыне, как я посмотрю. Если я не успею вмешаться в бой за сутки, вожака убьют. Плохо себе представляю возможные последствия! Профессор Кармен предупредила, что нельзя покидать земли во время боя, иначе поверженные противники успеют очнуться. Вперёд, пришло время грубой силы! Запись 9. Рык старого вожака стал свидетельством того, что всё закончилось, а справедливость восторжествовала в этих землях. Профессор Кармен отблагодарила меня за такое рвение помочь как жителям Западного Джото, так и самому прайду. Помимо ТМ 65 - Коготь тьмы я получила от неё Фрыкона, который отбился от прайда чужаков. А ещё вожак благосклонно разрешил мне находиться на территории прайда.",
